import '../generic.scss'

import './sidebar.scss'
import '../FlexShorthand/FlexShorthand'
import '../Card/Card'

import React from 'react'


class Sidebar extends React.Component {
    render() {
        return (
            <ColumnContainerExtended>
            <Card style={{flexGrow:1}}>Sidebar</Card>
          </ColumnContainerExtended>
        )
    }
}

export default Sidebar;
